INSERT INTO `ftree_v1_4_post` VALUES (6,1,'<center><b><i>Cập nhật ảnh đại diện</b></i></center>','2021-10-09 08:24:03'),(7,1,'<center><b><i>Cập nhật ảnh đại diện</b></i></center>','2021-10-09 08:59:25'),(8,1,'<center><b><i>Cập nhật ảnh bìa </b></i></center>','2021-10-09 13:37:13'),(9,1,'<center><b><i>Cập nhật ảnh đại diện</b></i></center>','2021-10-09 13:37:56'),(12,1,'<p>xin chao</p>','2021-10-09 15:13:47'),(15,388,'<p style=\"text-align:center;\"><i><strong>hello &nbsp;chao nhe+78</strong></i></p>','2021-11-01 10:01:37'),(16,42,'hello','0000-00-00 00:00:00'),(22,387,'<p>hh</p>','2021-10-11 08:38:31'),(23,387,'<p>xin chao moi nguoi</p>','2021-10-11 08:39:22'),(24,389,'<p>xin chao ca nha</p>','2021-10-12 01:44:58'),(27,389,'<p>gg</p>','2021-10-12 02:07:18'),(28,389,'<center><b><i>Cập nhật ảnh đại diện</b></i></center>','2021-10-12 02:10:18'),(29,389,'<center><b><i>Cập nhật ảnh bìa </b></i></center>','2021-10-12 02:10:31'),(33,389,'<center><b><i>Thêm 1 ảnh</b></i></center>','2021-10-12 02:57:22'),(34,389,'<center><b><i>Thêm 1 Video</b></i></center>','2021-10-12 02:57:42'),(35,389,'<h3 style=\"margin-left:0px;text-align:justify;\"><a href=\"https://www.thegioididong.com/dtdd/iphone-13-pro-max\">iPhone 13 Pro Max 128GB</a>&nbsp;- siêu phẩm được mong chờ nhất ở nửa cuối năm 2021 đến từ <a href=\"https://www.thegioididong.com/apple\">Apple</a>. Máy có thiết kế không mấy đột phá khi so với người tiền nhiệm, bên trong đây vẫn là một sản phẩm có màn hình siêu đẹp, tần số quét được nâng cấp lên 120 Hz mượt mà, cảm biến camera có kích thước lớn hơn, cùng hiệu năng mạnh mẽ với sức mạnh đến từ Apple A15 Bionic, sẵn sàng cùng bạn chinh phục mọi thử thách.</h3><h3 style=\"margin-left:0px;text-align:justify;\">Thiết kế đẳng cấp hàng đầu</h3><p style=\"margin-left:0px;text-align:justify;\">iPhone mới kế thừa thiết kế đặc trưng từ&nbsp;<a href=\"https://www.thegioididong.com/dtdd/iphone-12-pro-max\">iPhone 12 Pro Max</a> khi sở hữu khung viền vuông vức, mặt lưng kính cùng màn hình tai thỏ tràn viền nằm ở phía trước.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-3.jpg\" alt=\"Thiết kế vuông vức đặc trưng - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Với iPhone 13 Pro Max phần tai thỏ đã được thu gọn lại 20% so với thế hệ trước, không chỉ giải phóng nhiều không gian hiển thị hơn mà còn giúp mặt trước chiếc <a href=\"https://www.thegioididong.com/dtdd\">điện thoại</a> trở nên hấp dẫn hơn mà vẫn đảm bảo được hoạt động của các cảm biến.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-2.jpg\" alt=\"Màn hình tai thỏ được tinh giản - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Điểm thay đổi dễ dàng nhận biết trên iPhone 13 Pro Max chính là kích thước của cảm biến camera sau được làm to hơn và để tăng độ nhận diện cho sản phẩm mới thì Apple cũng đã bổ sung một tùy chọn màu sắc&nbsp;Sierra Blue (màu xanh dương nhạt hơn so với Pacific Blue của iPhone 12 Pro Max).</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-9.jpg\" alt=\"Sierra Blue trẻ trung, thanh lịch - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Máy vẫn tiếp tục sử dụng khung viền thép cao cấp cho khả năng chống trầy xước và va đập một cách vượt trội, kết hợp với khả năng <a href=\"https://www.thegioididong.com/dtdd-chong-nuoc-bui\">kháng bụi, nước</a>&nbsp;chuẩn IP68.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-4.jpg\" alt=\"Viền thép cao cấp - iPhone 13 Pro Max 128GB\"></p><h3 style=\"margin-left:0px;text-align:justify;\">Màn hình giải trí siêu mượt cùng tần số quét 120 Hz</h3><p style=\"margin-left:0px;text-align:justify;\">iPhone 13 Pro Max được trang bị màn hình kích thước 6.7 inch cùng độ phân giải 1284 x 2778 Pixels, sử dụng tấm nền OLED cùng công nghệ Super Retina XDR cho khả năng tiết kiệm năng lượng vượt trội nhưng vẫn đảm bảo hiển thị sắc nét sống động chân thực.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-5.jpg\" alt=\"Màn hình kích thước 6.7 inch - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">iPhone Pro Max năm nay đã được nâng cấp lên tần số quét 120 Hz, mọi thao tác chuyển cảnh khi lướt ngón tay trên màn hình trở nên mượt mà hơn đồng thời hiệu ứng thị giác khi chúng ta chơi game hoặc xem video cũng cực kỳ mãn nhãn.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-6.jpg\" alt=\"Tốc độ làm tươi màn hình - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Cùng công nghệ ProMotion thông minh có thể thay đổi tần số quét từ 10 đến 120 lần mỗi giây tùy thuộc vào ứng dụng, thao tác bạn đang sử dụng, nhằm tối ưu thời lượng sử dụng pin và trải nghiệm của bạn.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-1.jpg\" alt=\"Công nghệ ProMotion thông minh - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Nếu bạn dùng iPhone 13 Pro Max để chơi game, tần số quét 120 Hz kết hợp hiệu suất đồ họa tuyệt vời của GPU sẽ khiến máy trở nên vô cùng hoàn hảo khi trải nghiệm.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-8.jpg\" alt=\"Mang đến trải nghiệm mượt mà - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Ngoài ra máy cũng hỗ trợ công nghệ True Tone, dải màu rộng chuẩn điện ảnh P3 sẽ cho mọi trải nghiệm của bạn trên máy trở nên ấn tượng hơn bao giờ hết.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-20.jpg\" alt=\"Dải màu chuẩn điện ảnh P3 - iPhone 13 Pro Max 128GB\"></p><h3 style=\"margin-left:0px;text-align:justify;\">Cụm camera được nâng cấp toàn diện</h3><p style=\"margin-left:0px;text-align:justify;\">iPhone 13 Pro Max vẫn sẽ có bộ camera 3 ống kính xếp xen kẽ thành một cụm vuông, đặt ở góc trên bên trái của lưng máy gồm <a href=\"https://www.thegioididong.com/dtdd-camera-zoom\">camera telephoto</a>, camera <a href=\"https://www.thegioididong.com/dtdd-camera-goc-rong\">góc siêu rộng</a>&nbsp;và camera chính góc rộng với khẩu độ f/1.5 siêu lớn.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-21.jpg\" alt=\"Cụm camera chuyên nghiệp - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Camera góc siêu rộng cũng được nâng cấp với khẩu độ f/1.8, cảm biến nhanh hơn, mang tới những bức ảnh góc siêu rộng tự nhiên và chân thực và còn tăng cường có khả năng lấy nét ở khoảng cách chỉ 2 cm, mang đến tính năng chụp ảnh quay phim macro đầy thú vị.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-10.jpg\" alt=\"Lấy nét ở khoảng cách 2cm - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Camera tele trên iPhone 13 Pro Max có thể zoom quang học 3x, phóng to hình ảnh và video gấp 3 lần nhưng vẫn giữ nguyên chất lượng, hỗ trợ chụp ảnh chân dung <a href=\"https://www.thegioididong.com/dtdd-camera-xoa-phong\">xóa phông</a>, tích hợp sẵn rất nhiều bộ lọc màu tự nhiên giúp có được bức ảnh đúng như ý muốn.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-11.jpg\" alt=\"Khả năng zoom quang học - iPhone 13 Pro Max 128GB\"></p>','2021-10-12 03:03:11'),(36,389,'<h3 style=\"margin-left:0px;text-align:justify;\"><a href=\"https://www.thegioididong.com/dtdd/iphone-13-pro-max\">iPhone 13 Pro Max 128GB</a>&nbsp;- siêu phẩm được mong chờ nhất ở nửa cuối năm 2021 đến từ <a href=\"https://www.thegioididong.com/apple\">Apple</a>. Máy có thiết kế không mấy đột phá khi so với người tiền nhiệm, bên trong đây vẫn là một sản phẩm có màn hình siêu đẹp, tần số quét được nâng cấp lên 120 Hz mượt mà, cảm biến camera có kích thước lớn hơn, cùng hiệu năng mạnh mẽ với sức mạnh đến từ Apple A15 Bionic, sẵn sàng cùng bạn chinh phục mọi thử thách.</h3><h3 style=\"margin-left:0px;text-align:justify;\">Thiết kế đẳng cấp hàng đầu</h3><p style=\"margin-left:0px;text-align:justify;\">iPhone mới kế thừa thiết kế đặc trưng từ&nbsp;<a href=\"https://www.thegioididong.com/dtdd/iphone-12-pro-max\">iPhone 12 Pro Max</a> khi sở hữu khung viền vuông vức, mặt lưng kính cùng màn hình tai thỏ tràn viền nằm ở phía trước.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-3.jpg\" alt=\"Thiết kế vuông vức đặc trưng - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Với iPhone 13 Pro Max phần tai thỏ đã được thu gọn lại 20% so với thế hệ trước, không chỉ giải phóng nhiều không gian hiển thị hơn mà còn giúp mặt trước chiếc <a href=\"https://www.thegioididong.com/dtdd\">điện thoại</a> trở nên hấp dẫn hơn mà vẫn đảm bảo được hoạt động của các cảm biến.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-2.jpg\" alt=\"Màn hình tai thỏ được tinh giản - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Điểm thay đổi dễ dàng nhận biết trên iPhone 13 Pro Max chính là kích thước của cảm biến camera sau được làm to hơn và để tăng độ nhận diện cho sản phẩm mới thì Apple cũng đã bổ sung một tùy chọn màu sắc&nbsp;Sierra Blue (màu xanh dương nhạt hơn so với Pacific Blue của iPhone 12 Pro Max).</p><p style=\