</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-1.jpg\" alt=\"Công nghệ ProMotion thông minh - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Nếu bạn dùng iPhone 13 Pro Max để chơi game, tần số quét 120 Hz kết hợp hiệu suất đồ họa tuyệt vời của GPU sẽ khiến máy trở nên vô cùng hoàn hảo khi trải nghiệm.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-8.jpg\" alt=\"Mang đến trải nghiệm mượt mà - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Ngoài ra máy cũng hỗ trợ công nghệ True Tone, dải màu rộng chuẩn điện ảnh P3 sẽ cho mọi trải nghiệm của bạn trên máy trở nên ấn tượng hơn bao giờ hết.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-20.jpg\" alt=\"Dải màu chuẩn điện ảnh P3 - iPhone 13 Pro Max 128GB\"></p><h3 style=\"margin-left:0px;text-align:justify;\">Cụm camera được nâng cấp toàn diện</h3><p style=\"margin-left:0px;text-align:justify;\">iPhone 13 Pro Max vẫn sẽ có bộ camera 3 ống kính xếp xen kẽ thành một cụm vuông, đặt ở góc trên bên trái của lưng máy gồm <a href=\"https://www.thegioididong.com/dtdd-camera-zoom\">camera telephoto</a>, camera <a href=\"https://www.thegioididong.com/dtdd-camera-goc-rong\">góc siêu rộng</a>&nbsp;và camera chính góc rộng với khẩu độ f/1.5 siêu lớn.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-21.jpg\" alt=\"Cụm camera chuyên nghiệp - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Camera góc siêu rộng cũng được nâng cấp với khẩu độ f/1.8, cảm biến nhanh hơn, mang tới những bức ảnh góc siêu rộng tự nhiên và chân thực và còn tăng cường có khả năng lấy nét ở khoảng cách chỉ 2 cm, mang đến tính năng chụp ảnh quay phim macro đầy thú vị.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-10.jpg\" alt=\"Lấy nét ở khoảng cách 2cm - iPhone 13 Pro Max 128GB\"></p><p style=\"margin-left:0px;text-align:justify;\">Camera tele trên iPhone 13 Pro Max có thể zoom quang học 3x, phóng to hình ảnh và video gấp 3 lần nhưng vẫn giữ nguyên chất lượng, hỗ trợ chụp ảnh chân dung <a href=\"https://www.thegioididong.com/dtdd-camera-xoa-phong\">xóa phông</a>, tích hợp sẵn rất nhiều bộ lọc màu tự nhiên giúp có được bức ảnh đúng như ý muốn.</p><p style=\"margin-left:0px;text-align:justify;\"><img src=\"https://cdn.tgdd.vn/Products/Images/42/230529/iphone-13-pro-max-11.jpg\" alt=\"Khả năng zoom quang học - iPhone 13 Pro Max 128GB\"></p>','2021-10-12 03:18:45'),(38,386,'<p>hello</p>','2021-10-13 09:34:15'),(39,386,'<p>heelo 🎟🎟🎟🖼🎭🎪👓🕶🥽</p>','2021-10-13 09:37:51'),(40,386,'<center><b><i>Cập nhật ảnh đại diện</b></i></center>','2021-10-13 09:38:09'),(41,386,'<p>hêllo</p>','2021-11-01 08:40:54'),(45,388,'<p style=\"margin-left:10px;\"><span style=\"background-color:hsl(90,75%,60%);\"><s>Accept-Encoding, User-Agent</s></span></p><ol style=\"list-style-type:none;\"><li><span style=\"background-color:hsl(90,75%,60%);\"><s><strong>Request Headers value</strong></s></span></li></ol>','2021-11-01 11:14:31'),(49,388,'<p>eeerrr huhuhu</p>','2021-11-01 11:24:31'),(50,388,'<p>emhost</p>','2021-11-01 11:33:54'),(51,388,'<p>emhost</p>','2021-11-01 11:34:14'),(52,388,'<p>777799999</p>','2021-11-01 11:43:49'),(53,388,'<p>909090</p>','2021-11-01 11:44:13'),(54,1789,'<p>hello</p>','2021-11-20 07:24:54'),(55,1789,'<p>ggg</p>','2021-11-20 07:36:10'),(56,1789,'<p>eeeeeee</p>','2021-11-20 08:29:49'),(57,1789,'<p>helllo</p>','2021-11-20 08:30:05'),(58,154,'<p>hello</p>','2021-11-22 07:14:19'),(59,154,'<p>sss</p>','2021-11-22 07:21:21'),(60,154,'<p>ggg</p>','2021-11-22 07:34:51'),(63,154,'<p>hhhh</p>','2021-11-22 07:46:01'),(66,154,'<p>ddd</p>','202